	public static boolean runTestDuplicates(int start, int end, int num, String ans) {
		AVL tree = new AVL();
		Tuple tuple = null;
		Tuple tuple1 = null;
		Node node = null;
		int counter = 1;
		for (int i = start; i < end; i++, counter++) {
			String str1 = names[i];
			Character[] arr1 = str1.chars().mapToObj(c -> (char) c).toArray(Character[]::new);
			tuple = new Tuple(arr1);
			String str2 = names[end - counter];
			Character[] arr2 = str2.chars().mapToObj(c -> (char) c).toArray(Character[]::new);
			tuple = new Tuple(arr1);
			tuple1 = new Tuple(arr2);

			node = tree.insert(node, tuple);
			node = tree.insert(node, tuple1);
		}
		String studentAns = tree.levelOrder(node);
		return printResults(studentAns, ans, num);
	}

